import React from 'react';
// import logo from './logo.svg';
// import { Counter } from './features/counter/Counter';
import {Container, Navbar, NavbarBrand} from "reactstrap";
import './App.css';
import ProjectLogo from "./app/assets/img/logo.png";
import ProjectCard from './features/projects/ProjectCard.js';
import  { PROJECTS }  from './app/shared/PROJECTS.js';


function App() {
  return (
    <div className="App">
        <Navbar dark color="primary" sticky="top" expand="md" className="navbar">
        <Container>
            <NavbarBrand href="/">
              <img src={ProjectLogo} alt="Logo" className="logo-img"/>
            </NavbarBrand>
          </Container>
        </Navbar>
        Get Ready to Code!
    </div>
  );
}

export default App;
